const MainHeader = () => {
  return (
    <header>
      <nav>
        <li>
          <a href="/welcome">Welcome</a>
        </li>
        <li>
          <a href="/products">Products</a>
        </li>
      </nav>
    </header>
  );
};

export default MainHeader;
